import React, { Component } from "react";
import { render } from "react-dom";
import App from "./App";

class Result extends React.Component {

static propTypes = {
    result :'',
}
  
 render(){
    return(
        <div>
            <p> {this.props.value} </p>
            </div> 
    )
}
}

export default Result;
